import React, { useState } from 'react';
import { Box, Grid, Card, CardContent, Typography, Button } from '@mui/material';

const mockThemes = [
	{ key: 'light', name: 'Light', description: 'Bright and clean', color: '#fff', preview: 'linear-gradient(135deg, #fff 60%, #e0e0e0 100%)' },
	{ key: 'dark', name: 'Dark', description: 'Sleek and modern', color: '#222', preview: 'linear-gradient(135deg, #232526 60%, #414345 100%)' },
	{ key: 'aqua', name: 'Aqua', description: 'Cool blue vibes', color: '#4ecdc4', preview: 'linear-gradient(135deg, #4ecdc4 60%, #556270 100%)' },
	{ key: 'sunset', name: 'Sunset', description: 'Warm orange and pink', color: '#ff9966', preview: 'linear-gradient(135deg, #ff9966 60%, #ff5e62 100%)' },
	{ key: 'forest', name: 'Forest', description: 'Earthy green tones', color: '#228B22', preview: 'linear-gradient(135deg, #228B22 60%, #a8e063 100%)' },
	{ key: 'midnight', name: 'Midnight', description: 'Deep blue night', color: '#232526', preview: 'linear-gradient(135deg, #232526 60%, #414345 100%)' },
	{ key: 'lavender', name: 'Lavender', description: 'Soft purple hues', color: '#b993d6', preview: 'linear-gradient(135deg, #b993d6 60%, #8ca6db 100%)' },
	{ key: 'peach', name: 'Peach', description: 'Gentle peachy tones', color: '#ffecd2', preview: 'linear-gradient(135deg, #ffecd2 60%, #fcb69f 100%)' },
	{ key: 'ocean', name: 'Ocean', description: 'Blue and teal waves', color: '#2193b0', preview: 'linear-gradient(135deg, #2193b0 60%, #6dd5ed 100%)' },
];

const RoomThemes = () => {
	const [selected, setSelected] = useState('light');

	const handleSelect = (key) => {
		setSelected(key);
	};

		return (
			<Box sx={{ p: 3 }}>
				<Typography variant="h4" sx={{ mb: 3, fontWeight: 700, letterSpacing: 1 }}>
					Room Themes
				</Typography>
				<Grid container spacing={3}>
					{mockThemes.map((theme) => (
						<Grid item xs={12} sm={6} md={4} key={theme.key}>
							<Card
								sx={{
									background: theme.preview,
									color: theme.key === 'dark' || theme.key === 'midnight' ? '#fff' : '#222',
									border: selected === theme.key ? '2px solid #4ecdc4' : '2px solid transparent',
									boxShadow: selected === theme.key ? 8 : 2,
									cursor: 'pointer',
									transition: 'all 0.2s',
									minHeight: 180,
									display: 'flex',
									flexDirection: 'column',
									justifyContent: 'center',
									alignItems: 'center',
									position: 'relative',
									overflow: 'hidden',
								}}
								onClick={() => handleSelect(theme.key)}
							>
								<CardContent sx={{ width: '100%', textAlign: 'center' }}>
									<Typography variant="h6" sx={{ fontWeight: 700, mb: 1, letterSpacing: 0.5 }}>
										{theme.name}
									</Typography>
									<Typography variant="body2" sx={{ mb: 2, opacity: 0.85 }}>
										{theme.description}
									</Typography>
									<Button
										variant={selected === theme.key ? 'contained' : 'outlined'}
										color="primary"
										size="small"
										sx={{ mt: 1, fontWeight: 600, borderRadius: 2 }}
										onClick={(e) => {
											e.stopPropagation();
											handleSelect(theme.key);
										}}
									>
										{selected === theme.key ? 'Selected' : 'Select'}
									</Button>
									{selected === theme.key && (
										<Box sx={{
											position: 'absolute',
											top: 8,
											right: 8,
											background: '#4ecdc4',
											color: '#fff',
											borderRadius: '50%',
											width: 24,
											height: 24,
											display: 'flex',
											alignItems: 'center',
											justifyContent: 'center',
											fontWeight: 700,
											fontSize: 16,
										}}>
											âœ“
										</Box>
									)}
								</CardContent>
							</Card>
						</Grid>
					))}
				</Grid>
			</Box>
		);
};

export default RoomThemes;
